import React from "react";

function App(){
    return (
        <div className="login-screen">
            <h1>Welcome</h1>
            <div className="buttons-area">
                <h4>Please login/register to use our app</h4>
                <button>Login</button>
                <button>Register</button>
            </div>
        </div>
    )
}

export default App;
